from sympy import factorint, divisors
def ok(n):
    f=factorint(n)
    ex=[f[i] for i in f]
    for i in ex:
        if ex.count(i)>1: return 0
    return 1
def a(n): return sum([1 for i in divisors(n) if ok(i)]) # _Indranil Ghosh_, May 27 2017

